import React, { useState } from 'react';
import axios from 'axios';
import '../Main/dashboard.css'; 
import './appointment.css';
import { createMemoryRouter } from 'react-router-dom';

function Appointment() {
  const [fullName, setFullName] = useState("");
  const [telephone, setTelephone] = useState("");
  const [address, setAddress] = useState("");
  const [description, setDescription] = useState("");
  const [carModel, setCarModel] = useState("");

  const handleChange = (event) => {
    switch (event.target.name) {
      case 'fullName':
        setFullName(event.target.value);
        break;
      case 'telephone':
        setTelephone(event.target.value);
        break;
      case 'address':
        setAddress(event.target.value);
        break;
      case 'description':
        setDescription(event.target.value);
        break;
      case 'carModel':
          setDescription(event.target.value);
          break;
      default:
        break;
    }
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    const appointment = { fullName, telephone, address, description, carModel };
    await axios.post('/api/appointments', appointment);
  };

  return (
    <div className="box">
      <div className="minibox">
        <a href="/dashboard">OVERVIEW</a>
        <a className="selected_box" href="/dashboard/appointment">APPOINTMENT</a>
        <a href="/dashboard/cars">YOUR CARS</a>
        <a href="/dashboard/settings">SETTINGS</a>
      </div>
      <div className="minibox_2">
        <a href="/appointment">PH 52 WWX</a>
        <a href="/appointment">B 611 GRO</a>
        <a href="/appointment">DB 55 STR</a>
        <a href="/appointment">BZ 11 UWZ</a>
        <a href="/appointment">BZ 11 UWZ</a>
      </div>
      <div className="bigbox">
        <h1>APPOINTMENT</h1>
        <p> | Need repair? |</p>
        <div className="info_data">ADD YOUR INFORMATIONS</div>
        <div className="appointment">
          <div className="appointment_box">
            <form onSubmit={handleSubmit}>
              <input className="text_input" type="text" name="fullName" value={fullName} onChange={handleChange} placeholder="Full Name" required />
              <input className="text_input" type="tel" name="telephone" value={telephone} onChange={handleChange} placeholder="Telephone" required />
              <input className="text_input" type="text" name="address" value={address} onChange={handleChange} placeholder="Address" required />
              <input className="text_input" name="description" value={description} onChange={handleChange} placeholder="Description of problem" required />
            </form>
          </div>
          <div className="appointment_box_2">
          <form onSubmit={handleSubmit}>
              <input className="text_input" type="text" name="carModel" value={carModel} onChange={handleChange} placeholder="Car Model" required />
              <input className="text_input" type="tel" name="telephone" value={telephone} onChange={handleChange} placeholder="Telephone" required />
              <input className="text_input" type="text" name="address" value={address} onChange={handleChange} placeholder="Address" required />
              <input className="text_input" name="description" value={description} onChange={handleChange} placeholder="Description of problem" required />
            </form>
          </div>
          <button className="submit_2" type="submit">Submit</button>
        </div>     
      </div>
    </div>
  );
}

export default Appointment;
